import { useEffect, useState } from "react"
import { Link } from "react-router-dom"
import Bookmark from './../pages/Bookmark'
import ProductList from './../pages/ProductList'


export default function Main() {
    const [isProduct, setProduct] = useState([1, 2, 3, 4])
    const [isBookmark, setBookmark] = useState([1, 2, 3, 4])

    return (
        <div className="main">
            <div className="container">
                <Link to="/product"><button>상품리스트</button></Link>
                <ProductList isProduct={isProduct} />
                <Link to="/bookmark" ><button>북마크리스트</button></Link>
                <Bookmark />
            </div>
        </div>
    )
}
